IddObject createCatchallIddObject() {

  static IddObject object;

  // Catchall is the type of IddObject returned by the default constructor.
  OS_ASSERT(object.type() == IddObjectType::Catchall);
  return object;
}

IddObject createCommentOnlyIddObject() {

  static IddObject object;

  if (object.type() == IddObjectType::Catchall) {
    std::stringstream ss;
    ss << "CommentOnly; ! Autogenerated comment only object." << std::endl;

    IddObjectType objType(IddObjectType::CommentOnly);
    OptionalIddObject oObj = IddObject::load("CommentOnly",
                                             "",
                                             ss.str(),
                                             objType);
    OS_ASSERT(oObj);
    object = *oObj;
  }

  return object;
}

