IddFile IddFactorySingleton::getIddFile(IddFileType fileType) const {
  IddFile result;

  if (fileType == IddFileType::UserCustom) {
    return result; 
  }

  // Add the IddObjects.
  for(IddObjectCallbackMap::const_iterator it = m_callbackMap.begin(),
      itend = m_callbackMap.end(); it != itend; ++it) {
    if (isInFile(it->first,fileType)) {
      // This lock is necessary to protect construction of the statics used in the callbacks 
      QMutexLocker l(&m_callbackmutex);
      result.addObject(it->second());
    }
  }

  // Set the file version and header.
  try {
    result.setVersion(getVersion(fileType));
    result.setHeader(getHeader(fileType));
  }
  catch (...) {}

  return result;
}

boost::optional<IddFile> IddFactorySingleton::getIddFile(IddFileType fileType, const VersionString& version) const {
  OptionalIddFile result;

  if (fileType == IddFileType::UserCustom) {
    return result; 
  }

  if (fileType == IddFileType::WholeFactory) {
    LOG(Warn,"Cannot return the WholeFactory IddFile by version.");
    return result;
  }

  if (fileType == IddFileType::EnergyPlus) {
    LOG(Warn,"At this time, OpenStudio cannot return EnergyPlus IDD files by version.");
    return result;
  }

  VersionString currentVersion(openStudioVersion());
  OS_ASSERT(fileType == IddFileType::OpenStudio);
  if (version == currentVersion) {
    return getIddFile(fileType);
  }
  else {
    std::map<VersionString, IddFile>::const_iterator it = m_osIddFiles.find(version);
    if (it != m_osIddFiles.end()) {
      return it->second;
    }
    std::string iddPath = ":/idd/versions";
    std::stringstream folderString;
    folderString << version.major() << "_" << version.minor() << "_" << version.patch().get();
    iddPath += "/" + folderString.str() + "/OpenStudio.idd";
    if (::openstudio::embedded_files::hasFile(iddPath) && (version < currentVersion)) {
      std::stringstream ss;
      ss << ::openstudio::embedded_files::getFileAsString(iddPath);
      result = IddFile::load(ss);
    }
    if (result) {
      QMutexLocker l(&m_callbackmutex);
      m_osIddFiles[version] = *result;
    }
  }
  return result;
}

bool IddFactorySingleton::isInFile(IddObjectType objectType, IddFileType fileType) const {
  typedef IddObjectSourceFileMap::const_iterator const_iterator;
  std::pair<const_iterator,const_iterator> range;
  range = m_sourceFileMap.equal_range(objectType);
  for (const_iterator it = range.first; it != range.second; ++it) {
    if ((it->second == fileType) || (fileType == IddFileType::WholeFactory)) {
      return true;
    }
  }

  return false;
}
